import React, { useState } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

export function LoginForm({ Login, error }) {
  const [info, setInfo] = useState({email: '', password: ''});

  const submitHandler = event => {
    event.preventDefault();

    Login(info);
  }

  return (
    // <form onSubmit={submitHandler}>
    //   <div className='login-form'>
    //     <h2>Login</h2>

    //     <div className='form-group'>
    //       <label htmlFor='email'>Email:</label>
    //       <input type='email' name='email' id='email' onChange={event => setInfo({...info, email: event.target.value})} value={info.email}/>
    //     </div>
    //     <div className='form-group'>
    //       <label htmlFor='password'>Password:</label>
    //       <input type='password' name='password' id='password' onChange={event => setInfo({...info, password: event.target.value})} value={info.password}/>
    //     </div>
    //     <input type='submit' value='LOGIN'/>
    //   </div>
    // </form>
    <div className="Auth-form-container">
      <form className="Auth-form" onSubmit={submitHandler}>
        <div className="Auth-form-content">
          <h3 className="Auth-form-title">LO In</h3>
          <div className="form-group mt-3">
            <label>Email address</label>
            <input
              type="email"
              className="form-control mt-1"
              placeholder="Enter email"
              onChange={event => setInfo({...info, email: event.target.value})} value={info.email}
            />
          </div>
          <div className="form-group mt-3">
            <label>Password</label>
            <input
              type="password"
              className="form-control mt-1"
              placeholder="Enter password"
              onChange={event => setInfo({...info, password: event.target.value})} value={info.password}
            />
          </div>
          <div className="d-grid gap-2 mt-3">
            <button type="submit" className="btn btn-primary">Looin</button>
          </div>
        </div>
      </form>
    </div>
  )
}
